Research Excellence Framework:
The Research Excellence Framework (REF) is a research impact evaluation of British Higher Education Institutions (HEIs). It is the successor to the Research Assessment Exercise and it was first used in 2014 to assess the period 2008–2013. REF is undertaken by the four UK higher education funding bodies: Research England, the Scottish Funding Council (SFC), the Higher Education Funding Council for Wales (HEFCW), and the Department for the Economy, Northern Ireland (DfE). Its stated aims are to: inform the allocation of block-grant research funding to HEIs based on research quality;
provide accountability for public investment in research and produce evidence of the benefits of this investment; and
provide insights into the health of research in HEIs in the UK.

Sorption:
Sorption is a physical and chemical process by which one substance becomes attached to another. Specific cases of sorption are treated in the following articles: Absorption"the incorporation of a substance in one state into another of a different state" (e.g., liquids being absorbed by a solid or gases being absorbed by a liquid);
AdsorptionThe physical adherence or bonding of ions and molecules onto the surface of another phase (e.g., reagents adsorbed to a solid catalyst surface);
Ion exchangeAn exchange of ions between two electrolytes or between an electrolyte solution and a complex.
The reverse of sorption is desorption.
